question.query:
PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  dbp:  <http://dbpedia.org/property/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type  dbo:Automobile
      { ?uri  dbo:assembly  res:Netherlands }
    UNION
      { ?uri  dbp:assembly  res:Netherlands }
    UNION
      {   { ?uri  dbo:manufacturer  ?x }
        UNION
          { ?uri  dbp:manufacturer  ?x }
          { ?x  dbo:locationCountry  res:Netherlands }
        UNION
          { ?x  dbo:location  res:Netherlands }
      }
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  dbp:  <http://dbpedia.org/property/>
PREFIX  rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
SELECT DISTINCT  ?uri
WHERE
  { ?uri  rdf:type  dbo:Airport
      { ?uri  dbo:location  res:Chios }
    UNION
      { ?uri  dbp:location  res:Chios }
    UNION
      { ?uri  dbo:city  res:Chios }
    UNION
      { ?uri   dbo:city      ?city .
        ?city  dbo:isPartOf  res:Chios
      }
    UNION
      { ?uri  dbo:operator  res:Chios }
    UNION
      { ?uri  dbp:cityServed  res:Chios }
  }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  res:  <http://dbpedia.org/resource/>
PREFIX  rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT  ?uri ?string
WHERE
  {   { res:Romania  dbo:language  ?uri }
    UNION
      { ?uri  dbo:spokenIn  res:Romania }
    OPTIONAL
      { ?uri  rdfs:label  ?string
        FILTER ( lang(?string) = "en" )
      }
  }
